import React from "react";
import { Link } from "react-router-dom";

const RegistrasiComponent = () => {
  return (
    <section className="registrasi">
      <div className="logoInLogin">
        <img
          style={{ width: "100px" }}
          src={require("../media/logotoped.svg")}
        />
      </div>
    </section>
  );
};
export default RegistrasiComponent;
